import React from "react";
import './Footer.css'
function Footer() {
  return (
    <footer>
      <div className="social-media">
        <a>Facebook</a>
        <a>Instagram</a>
        <a>Twitter</a>
      </div>
      <div>Helmi Qatqat &copy</div>
  </footer>
  )
}

export default Footer
